import React, { Component } from "react";
import TripServices from "../services/TripServices";
import "./../assets/css/Style.css";
import { Card, Table, ButtonGroup, Button } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faList, faTrash } from "@fortawesome/free-solid-svg-icons";

class MatchTrips extends Component {
  constructor(props) {
    super(props);

    this.state = {
      //tripId: this.props.match.params.tripId,
      tripId: "6",
      trips: [],
    };
  }

  componentDidMount() {
    console.log(this.state.tripId);
    TripServices.GetmatchTrip(this.state.tripId).then((res) => {
      console.log(res.data);
      this.setState({
        trips: res.data,
      });
      console.log(this.state.trips[0].trip.tripId);
    });
  }
  render() {
    const { trips } = this.state;
    return (
      <div>
        <Card className={"border border-dark bg-dark text-white"}>
          <Card.Header>
            <div style={{ float: "left" }}>
              <FontAwesomeIcon icon={faList} /> Trip List
            </div>
          </Card.Header>
          <Card.Body>
            <Table bordered hover striped variant="dark">
              <thead>
                <tr>
                  <th>Name</th>
                  <th>Travel Date</th>
                  <th>Destination</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {trips.length === 0 ? (
                  <tr align="center">
                    <td colSpan="7">No Trips Available.</td>
                  </tr>
                ) : (
                  trips.map((mtrip) => (
                    <tr key={mtrip.trip.tripId}>
                      <td>
                        {mtrip.trip.user.firstName + mtrip.trip.user.lastName}
                      </td>
                      <td>{mtrip.trip.tripDate}</td>
                      <td>{mtrip.trip.destination}</td>
                      <td>
                        <ButtonGroup>
                          <Button
                            size="sm"
                            variant="outline-danger"
                            //onClick={this.deleteBook.bind(this, book.id)}
                          >
                            <FontAwesomeIcon icon={faTrash} />
                            Delete
                          </Button>
                        </ButtonGroup>
                      </td>
                    </tr>
                  ))
                )}
              </tbody>
            </Table>
          </Card.Body>
        </Card>
      </div>
    );
  }
}

export default MatchTrips;
